import React, { useState, useEffect, useContext } from "react";
import { Typography, Button, FormGroup, FormControlLabel, Checkbox } from '@material-ui/core';
import Favorite from '@material-ui/icons/Favorite';
import FavoriteBorder from '@material-ui/icons/FavoriteBorder';

import { Context } from '../Context';
import Navbar from "../Navbar";
import useStyles from '../styles';

function Account() {
  const {
    accountState,
    setAccountState,
    getAccountInfo
  } = useContext(Context);

  const {
    employee_id,
    username,
    first_name,
    last_name,
    email,
  } = accountState;

  useEffect(() => {
    //function to retrieve questions
    getAccountInfo();
  }, []);

  const [checkboxState, setCheckboxState] = React.useState({
    checkedA: true,
    checkedB: true,
    checkedF: true,
    checkedG: true,
  });

  const handleCheckboxChange = (event) => {
    setCheckboxState({ ...checkboxState, [event.target.name]: event.target.checked });
  };

  return (
    <main>
      <Navbar />
      <h2>Account</h2>
      <div>Employee ID: {employee_id}</div>
      <div>Username: {username}</div>
      <div>First Name: {first_name}</div>
      <div>Second Name: {last_name}</div>
      <div>Email: {email}</div>

      <Typography variant="h1">Hello Material UI!</Typography>
      <Typography variant="h2">Hello Material UI!</Typography>
      <Typography variant="h3">Hello Material UI!</Typography>

      <Button variant="outlined">Outlined Button</Button>
      <Button variant="outlined" color="primary">Primary Outlined Button</Button>
      <Button variant="outlined" color="secondary">Secondary Outlined Button</Button>
      <Button variant="outlined" disabled>Disabled Outlined Button</Button>

      <FormGroup row>
        <FormControlLabel
          control={
            <Checkbox 
              checked={checkboxState.checkedA} 
              onChange={handleCheckboxChange}
              name='checkedA'
              color='primary'
            />
          }
          label='primary'
        />
        <FormControlLabel
          control={
            <Checkbox 
              checked={checkboxState.checkedB} 
              onChange={handleCheckboxChange}
              name='checkedB'
              color='secondary'
            />
          }
          label='secondary'
        />
      </FormGroup>
      <FormControlLabel
        control={
          <Checkbox 
            icon={<FavoriteBorder />} 
            checkedIcon={<Favorite />} 
            name="checkedH" 
          />
        }
        label="My Favorite"
      />
    </main>
  );
}

export default Account;
